undercut_range = np.arange(0.2e-6, 0.501e-6, 0.01e-6)

def calc_r2(undercuts):
    r2_pullin = [r2_scores_pullin[uc][idy] for idy, uc in enumerate(undercuts)]
    r2_release = [r2_scores_release[uc][idy] for idy, uc in enumerate(undercuts)]
    print("R2 Pullin:", r2_pullin, np.mean(r2_pullin))
    print("R2 Release:", r2_release, np.mean(r2_release))
    rmse_pullin = [rmse_scores_pullin[uc][idy] for idy, uc in enumerate(undercuts)]
    rmse_release = [rmse_scores_release[uc][idy] for idy, uc in enumerate(undercuts)]
    print("RMSE Pullin:", rmse_pullin, np.mean(rmse_pullin))
    print("RMSE Release:", rmse_release, np.mean(rmse_release))

