best_uc_pullin_agg = []
best_uc_release_agg = []
best_uc_avg_agg = []
best_uc_min_agg = []
for idy in range(len(r2_scores_pullin[undercut_range[0]])):
    best_uc_pullin = undercut_range[np.argmax([r2_scores_pullin[uc][idy]
                                            for uc in undercut_range])]
    best_uc_release = undercut_range[np.argmax([r2_scores_release[uc][idy]
                                               for uc in undercut_range])]
    best_uc_avg = undercut_range[np.argmax([(r2_scores_pullin[uc][idy] + r2_scores_release[uc][idy])/2
                                            for uc in undercut_range])]
    best_uc_min = undercut_range[np.argmax([min(r2_scores_pullin[uc][idy], r2_scores_release[uc][idy])
                                            for uc in undercut_range])]
    best_uc_pullin_agg.append(best_uc_pullin)
    best_uc_release_agg.append(best_uc_release)
    best_uc_avg_agg.append(best_uc_avg)
    best_uc_min_agg.append(best_uc_min)
    print(idy, "|", best_uc_pullin, r2_scores_pullin[best_uc_pullin][idy],
          "|", best_uc_release, r2_scores_release[best_uc_release][idy],
          "|", best_uc_avg, (r2_scores_pullin[best_uc_avg][idy] + r2_scores_release[best_uc_avg][idy])/2,
          "|", best_uc_min, min(r2_scores_pullin[best_uc_min][idy], r2_scores_release[best_uc_min][idy]))

print("R2 metrics")
